import React from 'react';
import Slide from './Slide';

const App = () => {
  const slides = [
    {
      id: 'slide1',
      text: 'SLIDE 1',
    },
    {
      id: 'slide2',
      text: 'SLIDE 2',
    },
    {
      id: 'slide3',
      text: 'SLIDE 3',
    },
  ];

  return (
    <div>
      <Slide slides={slides} />
    </div>
  );
};

export default App;
